import React, { useEffect } from 'react'
import './Timer.css'
import { useState } from 'react'
const Timer = () => {
  let [time,settime] = useState(0)
useEffect(()=>{
    setInterval(()=>{
        settime(time+1)
    },1000)    
})
  return (
    <div>
      <h1>{time}</h1>
    </div>
  )
}

export default Timer
